import axiosClient from './axiosClient';

const assetTransferApi = {
    getLogs: (params) => {
        const url = '/asset-transfer/logs';
        return axiosClient.get(url, { params });
    },

    importAsset: (data) => {
        const url = '/asset-transfer/import';
        return axiosClient.post(url, data);
    },

    exportAsset: (data) => {
        const url = '/api/vanminh/asset-transfer/export';
        return axiosClient.post(url, data);
    },

    getInventory: (assetId) => {
        const url = `/api/vanminh/asset-transfer/inventory/${assetId}`;
        return axiosClient.get(url);
    }
};

export default assetTransferApi;
